import React from 'react';
import './MuscleMap.css'; // à créer ou compléter

const MuscleMapFull = ({ onSelect }) => {
  return (
    <svg
      id="Layer_2"
      data-name="Layer 2"
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 768.41 607.66"
      className="muscle-svg"
    >
      {/* Exemple pour les quadriceps */}
      <path
        className="quads"
        d="M228.64,315.88c6.67-4.85,9.59-16.75,18.25-18.34..."
        onClick={() => onSelect('quads-right')}
      />
      <path
        className="quads"
        d="M151.01,315.88c-6.67-4.85-9.59-16.75..."
        onClick={() => onSelect('quads-left')}
      />

      {/* Exemple pour les abdos */}
      <path
        className="abs"
        d="M201.32,139.46c-5.16-.07-8.88,2.3-8.99,7.59..."
        onClick={() => onSelect('abs-right')}
      />
      <path
        className="abs"
        d="M178.15,139.45c-26.37.11-18.74,28.52..."
        onClick={() => onSelect('abs-left')}
      />

      {/* Ajoute onClick pour chaque muscle : triceps, pecs, hamstrings, calves, etc. */}
    </svg>
  );
};

export default MuscleMapFull;
